            pluginElements.push(reactNativeReanimatedPlugin);
          }
        }
      }
    });

    return root.toSource();
  } catch (err) {
    console.log(`\x1b[31mError: ${(err as Error).message}\x1b[0m`);
    return file.source;
  }
};

